import styled from "@emotion/styled";
import { Box } from "@mui/system";

export const Container = styled(Box)(({ theme }) => ({
  flex: "3",
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  padding: "1rem"
}));

export const MainWrapper = styled(Box)(({ theme }) => ({
  width: "60rem",
  height: "inherit",
  display: "flex",
  flexDirection: "column",
  gap: ""
}));
